  [],\n\t\"revision_timestamp\": \"2016-10-03T22:07:22.792483\",\n\t\"name\": \"salinity-hydrostatic-pressure-sigma-theta-fluorescence-and-other-profile-data-collected-in-the-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0107210 includes profile,
  biological and physical data collected aboard NOAA Ship ALBATROSS IV, ENDEAVOR,
  OCEANUS and SEWARD JOHNSON during cruises AL9306, AL9403II, EN268, OC301, OC303,
  SJ9503, SJ9505 and SJ9507 in the Gulf of Guinea, Mediterranean Sea - Western Basin,
  North Atlantic Ocean, North Pacific Ocean and Tyrrhenian Sea from 1993-05-22 to
  1997-05-17. These data include SALINITY, HYDROSTATIC PRESSURE, SIGMA-THETA, FLUORESCENCE,
  Potential temperature (theta) and TRANSMISSIVITY. The instruments used to collect
  these data include CTD. These data were collected by Greg Lough and James P. Manning
  of National Marine Fisheries Service and Steve M. Bollens of Washington State University
  as part of GB. The Biological and Chemical Oceanography Data Management Office (BCO-DMO)
  submitted these data to NODC on 2013-04-26.nnThe following is the text of the abstract
  provided by BCO-DMO:nnThe MOCNESS is based on the Tucker Trawl principle (Tucker,
  1951). The particular MOCNESS system from which these CTD data came is one of three
  net systems. The MOCNESS-.25 carries nine rectangular nets (1/4-m2), usually with
  64 micrometer mesh. In all three MOCNESS systems, the underwater unit sends a data
  frame, comprised of temperature, depth, conductivity, net-frame angle, flow count,
  time, number of open net, and net opening/closing, to the deck unit in a compressed
  hexadecimal format every 2 seconds and from the deck unit to a microcomputer every
  4 seconds. Temperature (to approximately 0.01 deg C) and conductivity are measured
  with SEABIRD sensors. Normally, a modified T.S.K.-flowmeter is used. Both the temperature
  and conductivity sensors and the flowmeter are mounted on top of the frame so that
  they face horizontally when the frame is at a towing angle of 45deg. Calculations
  of salinity (to approximately 0.01 o/oo S), potential temperature (theta), potential
  density (sigma), the oblique and vertical velocities of the net, and the approximate
  volume filtered by each net are made after each string of data has been received
  by the computer. (Wiebe et al., 1985) In addition, data were collected from four
  other sensors attached to the frame: the Transmissometer, the Fluorometer, the Downwelling
  light sensor, and the Oxygen sensor. A SeaBird underwater pump was also included
  in the sensor suite.nIt should be noted that whenever the data are of questionable
  value, 50.000 is written in the particular data field.nUnless otherwise indicated,
  these data have not been post-processed.nFor additional information, contact the
  chief scientist (http://globec.whoi.edu/jg/serv/globec/gb/inventory.html0?project,name_prin)
  for the cruise or the U.S. GLOBEC Data Management Office (http://globec.whoi.edu/globec-dir/contact_dmo.html)
  (DMO).nNote: Some variables have been eliminated from the display but are nevertheless
  available. These variables include: oxycurrent, oxytemp, tempco, and echo.nReferencesnFofonoff
  and Millard, 1983, UNESCO technical papers in Marine Sciences, #44.nnTucker, G.H.,
  1951. Relation of fishes and other organisms to the scattering of underwater sound.
  Journal of Marine Research, 10: 215-238.nnWiebe, P.H., K.H. Burt, S. H. Boyd, A.W.
  Morton, 1976. The multiple opening/closing net and environmental sensing system
  for sampling zooplankton. Journal of Marine Research, 34(3): 313-326.nnWiebe, P.H.,
  A.W. Morton, A.M. Bradley, R.H. Backus, J.E. Craddock, V. Barber, T.J. Cowles and
  G.R. Flierl, 1985. New developments in the MOCNESS, an apparatus for sampling zooplankton
  and micronekton. Marine Biology, 87: 313-323.nnupdated September 30, 2008. mda\",\n\t\"license_title\":
